import '../App.css';


function FAQ() {


  return(


		  <div>
			  <h1>Pobblebonk FAQ</h1>

		  <details>
		      <summary>What is Pobblebonk?</summary>
			 Pobblebonk is the app to help people discover and support the live stand up comedy scene socially.   
		  </details>


		  </div>

  );
}


export default FAQ;
